import { useQuery } from "@apollo/client"
import { getUser } from "../../graphql/queries/user";
import { withApollo } from "../components/hooks/withApolloHook"
import { useRouter } from 'next/router';

const username = () => {
    // const router = useRouter();
    const { data, error, loading } = useQuery(getUser, {
        variables: 'kyle'
    });

    if(loading) {
        return <p>Loading...</p>
    }

    if(error) {
        return <div>{error.message}</div>
    }


    if(!data?.user) {
        <p>sad times man</p>
    }

    return (
        <p>{JSON.stringify(data.user)}</p>
    )
}

export default withApollo(username);
